import React, { Component } from "react";
import { Form } from 'protected-aidaforms';
import { useParams } from 'react-router-dom'; // import the useParams hook
import json from './InitialEvaluation.js';
import UtenteDataService from 'C:/Users/ines_/fisiosys/frontend/src/services/tutorial.service.js';
import { withRouter } from 'react-router-dom';

class Avininum extends Component {
  constructor(props) {
    super(props);
    this.state = {
      currentUtente: null
    };
  }

  componentDidMount() {
    const { num_sequencial } = this.props.match.params;
    // Make a request to retrieve the current utente based on the num_sequencial parameter
    UtenteDataService.get(num_sequencial)
      .then(response => {
        this.setState({ currentUtente: response.data });
      })
      .catch(error => {
        console.error('Error fetching utente:', error);
      });
  }

  render() {
    const { currentUtente } = this.state;
    if (!currentUtente) {
      // If the utente data has not been fetched yet, show a loading message
      return <div>Loading...</div>;
    }
    
    return (
      <Form
        onSubmit={(values, changedFields) => console.log("SUBMITTED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
        onSave={(values, changedFields) => console.log("SAVED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
        onCancel={status => console.log("CANCELLED:", status)}
        template={json}
        dlm={{}}
        showPrint={true}
        editMode={true}
        professionalTasks={["Registar Pedido", "Consultar Pedido", "Anular Pedido"]}
        canSubmit={true}
        canSave={true}
        canCancel={true}
        patientData={{
          "numSequencial": currentUtente.num_sequencial,
          "episodio": 21016848,
          "modulo": "INT",
          "processo": 99998888,
          "nome": currentUtente.nome,
          "dtaNascimento": currentUtente.data_nascimento,
          "idade": 77,
          "sexo": currentUtente.sexo
        }}
        reportData={{
          dtaEncerrada: "22-05-2019 13:02",
          dtaCriada: "10-05-2019 18:47",
          realizada: "Joana Pascoal",
          responsavel: "José Costa"
        }}
        referenceModel={[
          {
            "itemName": "Número mecanográfico",
            "item": "num_mecanografico",
            "value": "123456",
            "formVisible": true
          },
          {
            "itemName": "Número sequencial",
            "item": "num_seq",
            "value": currentUtente.num_sequencial,
            "formVisible": true
          },
          {
            "itemName": "Nome",
            "item": "Nome",
            "value": currentUtente.nome,
            "formVisible": true
          }
        ]}
        submitButtonDisabled={false}
        saveButtonDisabled={false}
      />
    );
  }
}

export default withRouter(Avininum);
